Patch Set 20:

(5 comments)

I experimented with JSON serialization and enums, and I learned that you can specify an enum as a integer value _or_ as a string. So we should definitely use enums throughout, as this allows both the ease of use of specifying a string value or the terseness of specifying an integer value, and the enum definition itself provides a good source of documentation.

Here's my code:

test.proto:
  syntax = "proto2";

  message Foo {
    enum Color {
      BLUE = 0;
      RED = 1;
      GREEN = 2;
    }
    optional Color c = 1;
  }


test.cc:
  #include <iostream>

  #include <google/protobuf/stubs/status.h>
  #include <google/protobuf/stubs/stringpiece.h>
  #include <google/protobuf/util/json_util.h>

  #include "test.pb.h"

  using namespace std;

  int main(int argc, char* argv[]) {
  if (argc != 2) {
    cout << "Usage: " << argv[0] << " <json>" << endl;
    return 1;
  }
  cout << "Attempting to parse JSON: \'" << argv[1] << "\'" << endl;
  Foo message;
  const auto& google_status = google::protobuf::util::JsonStringToMessage(argv[1], &message);
  if (!google_status.ok()) {
    cout << "unable to parse JSON: " << google_status.error_message().ToString() << endl;
    return 1;
  }

  cout << message.DebugString();
  return 0;
}

I compiled it with:
- protoc --cpp_out . test.proto
- g++ -o test test.cc test.pb.cc -I. -lprotobuf

Then I ran it a few times:
$ ./test "{ c : 1 }"
Attempting to parse JSON: '{ c : 1 }'
c: RED
$ ./test "{ c : red }"
Attempting to parse JSON: '{ c : red }'
unable to parse JSON: Unexpected token.
{ c : red }
      ^
$ ./test "{ c : 'red' }"
Attempting to parse JSON: '{ c : 'red' }'
c: RED
$ ./test "{ c : 'green' }"
Attempting to parse JSON: '{ c : 'green' }'
c: GREEN
$ ./test "{ c : 'pink' }"
Attempting to parse JSON: '{ c : 'pink' }'
unable to parse JSON: c: invalid value "pink" for type TYPE_ENUM
$ ./test "{ c : 2 }"
Attempting to parse JSON: '{ c : 2 }'
c: GREEN

Patch Set 22:

"we'll ensure that both missing values and unknown values return an error per your ToClientEncodingType and equivalent functions". 
I'm sorry, I don't understand this place. I think missing values is a normal behavior, not an error. If the user does not pass, use the default value. Only unknown values need to return an error.
Here I can define the enum type as int32, such as
  message CreateTablePB {
    enum EncodingType {
      UNKNOWN_ENCODING = 0;
      AUTO_ENCODING = 1;
    }
    optional int32 type = 1;
  }
then call Foo_IsValid(int value) on the enum after parsing it from JSON. But user can't pass it as character string. If keeping using enum, I think we can't use 'JsonStringToMessage' or 'ParseFromString' directly. Their enum results are different in different versions or systems. Maybe I should parse it by myself. Or do some extra work with enum types. We need to determine if it exists first, and then you can tell if it's the right value.

